const result = {};

msg.payload.userTask.userTaskConfig.formFields.forEach(function(element) {
    result[element.id] = `Test for ${element.label}`;   
});

msg.payload["formData"] = result;

return msg;

const table = [];

msg.payload.flowNodeInstances.forEach(function(element) {
    const row = {
            "flowNodeName": element.flowNodeName, 
            "state": element.state,
            "flowNodeInstanceId": element.flowNodeInstanceId,
            "startedAt": element.startedAt
        }

    if (element.state == "suspended") {
        row["action"] = "do it";
    } else {
        row["action"] = "nope ;-)";
    }

    table.push(row);
});;

msg.payload = table;
return msg;

msg.payload = { 
    page: "UserTask",
    query: {
        flowNodeName: msg.payload.flowNodeName,
        flowNodeInstanceId: msg.payload.flowNodeInstanceId,
        state: msg.payload.state,
        action: msg.payload.action
    }
};
return msg;

if (msg.payload.query && msg.payload.query.flowNodeInstanceId) {
    msg.payload = {
        "flowNodeInstanceId": msg.payload.query.flowNodeInstanceId
    };
}

return msg;

